import React, { Component } from 'react';
import Modal from '../Modal';





export default class WcList extends Component {
    constructor(props) {
        super(props);
        this.state = {
            properties: [],
            bicycle: true
        };
    }

    componentDidMount() {
        fetch('http://localhost:3001/water', { headers: { 'Content-Type': 'application/json' }, })
            .then(r => r.json())
            .then(properties => {
                this.setState({ properties, bicycle: false });
            });
    }


    render() {
        const { properties } = this.state;
        return (
            <div>


                <Modal properties={properties}>openfire:</Modal>






            </div>
        )
    }
}
